import React from 'react';
import './nps.mp4';

function Home() {
  return (
    <div>
      <h1>Welcome to the National Park Service Online Tour Guide!</h1>
      <video autoPlay loop muted>
        <source src={nps} type="video/mp4"></source>
      </video>
    </div>
  );
}

export default Home;
